import { useState } from "react";
const M = 5;
const N = 5;


function createDest(m, n) {
  let dest = Array.from({ length: m }, (_, i) => Array.from({ length: n }, (_, j) => i * n + j + 1));
  dest[m - 1][n - 1] = 0;
  return dest;
}

function shuffle(m, n) {
  let shuffled = Array.from({ length: m * n }, (_, i) => i);
  for (let i = shuffled.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
  }
  return Array.from({ length: m }, (_, i) => shuffled.slice(i * n, (i + 1) * n));
}

function heuristic(dest) {
  const m = dest.length;
  const n = dest[0].length;
  const locs = Array.from({ length: m * n }, () => [0, 0]);
  for (let i = 0; i < m; i++) {
      for (let j = 0; j < n; j++) {
          locs[dest[i][j]] = [i, j];
      }
  }
  function manhattans(puzzle) {
      let distance = 0;
      for (let i = 0; i < m; i++) {
          for (let j = 0; j < n; j++) {
              const [x, y] = locs[puzzle[i][j]];
              const manhattan = Math.abs(x - i) + Math.abs(y - j);
              distance += manhattan;
          }
      }
      return distance;
  }
  return manhattans;
}

function locateZero(puzzle) {
  for (let i = 0; i < puzzle.length; i++) {
      for (let j = 0; j < puzzle[0].length; j++) {
          if (puzzle[i][j] === 0) {
              return [i, j];
          }
      }
  }
}

function neighbors(status) {
  const puzzle = status.map(row => row.slice());
  const [i, j] = locateZero(puzzle);
  const neis = [[1, 0], [-1, 0], [0, 1], [0, -1]];
  const validNeighbors = [];
  for (const [di, dj] of neis) {
      const x = i + di;
      const y = j + dj;
      if (x >= 0 && x < puzzle.length && y >= 0 && y < puzzle[0].length) {
          [puzzle[i][j], puzzle[x][y]] = [puzzle[x][y], puzzle[i][j]];
          validNeighbors.push(puzzle.map(row => row.slice()));
          [puzzle[i][j], puzzle[x][y]] = [puzzle[x][y], puzzle[i][j]];
      }
  }
  return validNeighbors;
}

function traceToDest(visited, dest) {
  const path = [dest];
  while (visited[dest]) {
      const pre = visited[dest];
      path.push(pre);
      dest = pre;
  }
  return path.reverse();
}

function astar(puzzle, dest) {
  const manhattans = heuristic(dest);
  const start = puzzle.map(row => row.slice());
  const target = dest.map(row => row.slice());
  const startTuple = start.map(row => row.slice());
  const heap = [[manhattans(start), 0, startTuple]];
  const visited = {};
  visited[JSON.stringify(start)] = null;

  while (heap.length > 0) {
      const [evaluate, depth, status] = heap.shift();
      if (JSON.stringify(status) === JSON.stringify(target)) {
          break;
      }
      for (const nei of neighbors(status)) {
          const strNei = JSON.stringify(nei);
          if (!visited[strNei]) {
              visited[strNei] = status;
              heap.push([depth + 1 + manhattans(nei), depth + 1, nei]);
          }
      }
      heap.sort((a, b) => a[0] - b[0]);
  }

  if (!visited[JSON.stringify(target)]) {
      console.log("invalid puzzle");
      return null;
  }

  const path = traceToDest(visited, JSON.stringify(target));
  return path.map(step => step.map(row => row.slice()));
}

function Square({value, onClick}) {
  return (
    <button className="square" onClick={onClick}>
      {value}
    </button>
  );
}

